import styled from "styled-components";

export const Container1 = styled.div`
    position: static;
    width: 50%;
    height: 50%;
    margin: auto;
`;

export const Titulo = styled.h1`
    width: 45%;
    height: 50px;
    position: fixed;
    left: 100px;
    top: 150px;
    font-family: 'Montserrat', sans-serif;
    font-size: 2.5rem;
    font-weight: bolder;
    color: #313E50;
    margin-right: 20px;
    position: absolute;
`;
